import { useEffect, useState } from 'react';

const pageList = 5;
const itemsAmount = 25

function Pagination({ pageList, itemsAmount }) {
  const pagesAmount = []
  for (let i = 1; i <= Math.ceil(itemsAmount / pageList); i++) {
    pagesAmount.push(i)
  }
  console.log(pagesAmount)
  return (
    <div>
<ul className='pagination'>
  {
    pagesAmount.map(number => (
      <li className='pagination__page' key={number}>
        <a href="#" className='pagination__button'>{number}</a>
      </li>
    ))
  }
</ul>
    </div>
  )
}

export default Pagination()
